<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Equity and Crypto Market Dynamics Dash</title>
    <script crossorigin src="https://unpkg.com/react@18/umd/react.production.min.js"></script>
    <script crossorigin src="https://unpkg.com/react-dom@18/umd/react-dom.production.min.js"></script>
    <script src="https://unpkg.com/@babel/standalone/babel.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/chart.js@4.4.0/dist/chart.umd.min.js"></script>
    <link href="https://fonts.googleapis.com/css2?family=JetBrains+Mono:wght@400;600;700&family=Urbanist:wght@300;400;600;700;800&display=swap" rel="stylesheet">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        :root {
            --bg-dark: #0a0e14;
            --bg-card: #13171f;
            --bg-card-hover: #1a1f2e;
            --accent-green: #00ff88;
            --accent-red: #ff3366;
            --accent-blue: #00d4ff;
            --accent-purple: #b84fff;
            --accent-yellow: #ffcc00;
            --text-primary: #e4e6eb;
            --text-secondary: #8b92a5;
            --text-muted: #5a5f73;
            --border: #252934;
            --grid: rgba(255, 255, 255, 0.03);
        }

        body {
            font-family: 'Urbanist', sans-serif;
            background: var(--bg-dark);
            color: var(--text-primary);
            overflow-x: hidden;
            position: relative;
        }

        /* Animated background grid */
        body::before {
            content: '';
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background-image: 
                linear-gradient(var(--grid) 1px, transparent 1px),
                linear-gradient(90deg, var(--grid) 1px, transparent 1px);
            background-size: 50px 50px;
            z-index: 0;
            animation: gridScroll 20s linear infinite;
        }

        @keyframes gridScroll {
            0% { transform: translate(0, 0); }
            100% { transform: translate(50px, 50px); }
        }

        /* Gradient orbs */
        .orb {
            position: fixed;
            border-radius: 50%;
            filter: blur(80px);
            opacity: 0.15;
            z-index: 1;
            pointer-events: none;
        }

        .orb-1 {
            width: 600px;
            height: 600px;
            background: var(--accent-blue);
            top: -200px;
            right: -200px;
            animation: float 15s ease-in-out infinite;
        }

        .orb-2 {
            width: 500px;
            height: 500px;
            background: var(--accent-purple);
            bottom: -150px;
            left: -150px;
            animation: float 12s ease-in-out infinite reverse;
        }

        @keyframes float {
            0%, 100% { transform: translate(0, 0) scale(1); }
            50% { transform: translate(30px, -30px) scale(1.1); }
        }

        .dashboard {
            position: relative;
            z-index: 10;
            max-width: 1600px;
            margin: 0 auto;
            padding: 40px 30px;
            min-height: 100vh;
        }

        /* Header */
        .header {
            margin-bottom: 50px;
            animation: slideDown 0.6s ease-out;
        }

        @keyframes slideDown {
            from {
                opacity: 0;
                transform: translateY(-20px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .header h1 {
            font-family: 'JetBrains Mono', monospace;
            font-size: 2.8rem;
            font-weight: 800;
            letter-spacing: -0.02em;
            margin-bottom: 12px;
            background: linear-gradient(135deg, var(--accent-green), var(--accent-blue));
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
        }

        .header .subtitle {
            font-size: 1.1rem;
            color: var(--text-secondary);
            font-weight: 400;
            display: flex;
            align-items: center;
            gap: 15px;
            flex-wrap: wrap;
        }

        .stat-pill {
            font-family: 'JetBrains Mono', monospace;
            font-size: 0.85rem;
            padding: 6px 14px;
            background: var(--bg-card);
            border: 1px solid var(--border);
            border-radius: 20px;
            color: var(--text-muted);
        }

        .stat-pill strong {
            color: var(--accent-green);
            margin-left: 6px;
        }

        /* Tab Navigation */
        .tabs {
            display: flex;
            gap: 12px;
            margin-bottom: 40px;
            animation: slideDown 0.6s ease-out 0.1s backwards;
        }

        .tab {
            font-family: 'JetBrains Mono', monospace;
            font-size: 1rem;
            font-weight: 600;
            padding: 14px 32px;
            background: var(--bg-card);
            border: 2px solid var(--border);
            border-radius: 12px;
            color: var(--text-secondary);
            cursor: pointer;
            transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
            position: relative;
            overflow: hidden;
        }

        .tab::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: linear-gradient(135deg, var(--accent-green), var(--accent-blue));
            opacity: 0;
            transition: opacity 0.3s;
        }

        .tab span {
            position: relative;
            z-index: 1;
        }

        .tab:hover {
            border-color: var(--accent-blue);
            transform: translateY(-2px);
        }

        .tab.active {
            background: var(--bg-card-hover);
            border-color: var(--accent-green);
            color: var(--text-primary);
        }

        .tab.active::before {
            opacity: 0.1;
        }

        /* Content Grid */
        .content-grid {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 30px;
            animation: fadeIn 0.8s ease-out 0.2s backwards;
        }

        @keyframes fadeIn {
            from {
                opacity: 0;
                transform: translateY(20px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .section {
            background: var(--bg-card);
            border: 1px solid var(--border);
            border-radius: 20px;
            padding: 32px;
            transition: all 0.4s cubic-bezier(0.4, 0, 0.2, 1);
            position: relative;
            overflow: hidden;
        }

        .section::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 4px;
            background: linear-gradient(90deg, var(--accent-green), var(--accent-blue));
            transform: scaleX(0);
            transform-origin: left;
            transition: transform 0.4s cubic-bezier(0.4, 0, 0.2, 1);
        }

        .section:hover {
            border-color: var(--accent-blue);
            transform: translateY(-4px);
            box-shadow: 0 20px 60px rgba(0, 212, 255, 0.15);
        }

        .section:hover::before {
            transform: scaleX(1);
        }

        .section-header {
            display: flex;
            align-items: center;
            justify-content: space-between;
            margin-bottom: 28px;
        }

        .section-title {
            font-family: 'JetBrains Mono', monospace;
            font-size: 1.3rem;
            font-weight: 700;
            color: var(--text-primary);
            display: flex;
            align-items: center;
            gap: 12px;
        }

        .section-badge {
            font-size: 0.75rem;
            padding: 4px 10px;
            background: rgba(0, 255, 136, 0.1);
            border: 1px solid rgba(0, 255, 136, 0.3);
            border-radius: 6px;
            color: var(--accent-green);
            font-weight: 600;
        }

        /* Bar Chart */
        .bar-chart {
            display: flex;
            flex-direction: column;
            gap: 16px;
        }

        .bar-item {
            animation: slideInLeft 0.6s ease-out backwards;
        }

        @keyframes slideInLeft {
            from {
                opacity: 0;
                transform: translateX(-20px);
            }
            to {
                opacity: 1;
                transform: translateX(0);
            }
        }

        .bar-label {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 8px;
            font-size: 0.9rem;
        }

        .bar-ticker {
            font-family: 'JetBrains Mono', monospace;
            font-weight: 700;
            color: var(--text-primary);
            display: flex;
            align-items: center;
            gap: 10px;
        }

        .bar-name {
            font-size: 0.85rem;
            color: var(--text-muted);
            font-weight: 400;
        }

        .bar-value {
            font-family: 'JetBrains Mono', monospace;
            font-weight: 700;
            font-size: 1rem;
        }

        .bar-value.positive {
            color: var(--accent-green);
        }

        .bar-value.negative {
            color: var(--accent-red);
        }

        .bar-value.neutral {
            color: var(--accent-blue);
        }

        .bar-track {
            height: 12px;
            background: rgba(255, 255, 255, 0.05);
            border-radius: 6px;
            overflow: hidden;
            position: relative;
        }

        .bar-fill {
            height: 100%;
            border-radius: 6px;
            transition: width 1s cubic-bezier(0.4, 0, 0.2, 1);
            position: relative;
            overflow: hidden;
        }

        .bar-fill::after {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            width: 200%;
            height: 100%;
            background: linear-gradient(90deg, 
                transparent, 
                rgba(255, 255, 255, 0.2), 
                transparent);
            animation: shimmer 2s infinite;
        }

        @keyframes shimmer {
            0% { transform: translateX(-100%); }
            100% { transform: translateX(100%); }
        }

        .bar-fill.positive {
            background: linear-gradient(90deg, var(--accent-green), rgba(0, 255, 136, 0.6));
        }

        .bar-fill.negative {
            background: linear-gradient(90deg, var(--accent-red), rgba(255, 51, 102, 0.6));
        }

        .bar-fill.neutral {
            background: linear-gradient(90deg, var(--accent-blue), rgba(0, 212, 255, 0.6));
        }

        /* Legend */
        .legend {
            display: flex;
            gap: 20px;
            margin-bottom: 20px;
            padding: 16px;
            background: rgba(255, 255, 255, 0.03);
            border-radius: 12px;
            border: 1px solid var(--border);
        }

        .legend-item {
            display: flex;
            align-items: center;
            gap: 8px;
            font-size: 0.85rem;
            color: var(--text-secondary);
        }

        .legend-dot {
            width: 12px;
            height: 12px;
            border-radius: 50%;
        }

        .legend-dot.sector {
            background: var(--accent-blue);
            box-shadow: 0 0 10px rgba(0, 212, 255, 0.5);
        }

        .legend-dot.crypto {
            background: var(--accent-purple);
            box-shadow: 0 0 10px rgba(184, 79, 255, 0.5);
        }

        /* Info Card */
        .info-card {
            grid-column: 1 / -1;
            background: linear-gradient(135deg, rgba(0, 255, 136, 0.05), rgba(0, 212, 255, 0.05));
            border: 1px solid rgba(0, 255, 136, 0.2);
            border-radius: 16px;
            padding: 24px 32px;
            display: flex;
            justify-content: space-around;
            align-items: center;
            gap: 30px;
        }

        .info-stat {
            text-align: center;
        }

        .info-stat-label {
            font-size: 0.85rem;
            color: var(--text-muted);
            text-transform: uppercase;
            letter-spacing: 0.05em;
            margin-bottom: 8px;
        }

        .info-stat-value {
            font-family: 'JetBrains Mono', monospace;
            font-size: 1.8rem;
            font-weight: 700;
            color: var(--accent-green);
        }

        /* Time Series Section */
        .time-series-section {
            grid-column: 1 / -1;
            background: var(--bg-card);
            border: 1px solid var(--border);
            border-radius: 20px;
            padding: 32px;
            margin-top: 30px;
            position: relative;
            overflow: hidden;
        }

        .time-series-section::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 4px;
            background: linear-gradient(90deg, var(--accent-purple), var(--accent-yellow));
        }

        .chart-container {
            position: relative;
            height: 400px;
            margin-top: 20px;
        }

        .chart-controls {
            display: flex;
            gap: 10px;
            flex-wrap: wrap;
            margin-bottom: 20px;
        }

        .asset-toggle {
            font-family: 'JetBrains Mono', monospace;
            font-size: 0.75rem;
            padding: 8px 16px;
            background: var(--bg-card-hover);
            border: 1px solid var(--border);
            border-radius: 8px;
            color: var(--text-secondary);
            cursor: pointer;
            transition: all 0.3s;
            display: flex;
            align-items: center;
            gap: 8px;
        }

        .asset-toggle:hover {
            border-color: var(--accent-blue);
        }

        .asset-toggle.active {
            background: rgba(0, 255, 136, 0.1);
            border-color: var(--accent-green);
            color: var(--accent-green);
        }

        .asset-toggle.active.crypto {
            background: rgba(184, 79, 255, 0.1);
            border-color: var(--accent-purple);
            color: var(--accent-purple);
        }

        .toggle-indicator {
            width: 8px;
            height: 8px;
            border-radius: 50%;
            background: var(--text-muted);
            transition: background 0.3s;
        }

        .asset-toggle.active .toggle-indicator {
            background: var(--accent-green);
        }

        .asset-toggle.active.crypto .toggle-indicator {
            background: var(--accent-purple);
        }

        /* Returns Page Styles */
        .returns-grid {
            display: grid;
            grid-template-columns: 1fr;
            gap: 30px;
        }

        .returns-hero {
            grid-column: 1 / -1;
            background: linear-gradient(135deg, rgba(0, 255, 136, 0.1), rgba(0, 212, 255, 0.1));
            border: 2px solid rgba(0, 255, 136, 0.3);
            border-radius: 20px;
            padding: 40px;
            text-align: center;
            position: relative;
            overflow: hidden;
        }

        .returns-hero::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: linear-gradient(45deg, transparent 30%, rgba(255, 255, 255, 0.05) 50%, transparent 70%);
            animation: shimmer 3s infinite;
        }

        .returns-hero-label {
            font-size: 0.9rem;
            color: var(--text-muted);
            text-transform: uppercase;
            letter-spacing: 0.1em;
            margin-bottom: 10px;
        }

        .returns-hero-value {
            font-family: 'JetBrains Mono', monospace;
            font-size: 4rem;
            font-weight: 800;
            margin-bottom: 5px;
        }

        .returns-hero-value.positive {
            color: var(--accent-green);
        }

        .returns-hero-value.negative {
            color: var(--accent-red);
        }

        .returns-hero-ticker {
            font-size: 1.2rem;
            color: var(--text-secondary);
        }

        .returns-cards-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
            gap: 20px;
        }

        .return-card {
            background: var(--bg-card);
            border: 1px solid var(--border);
            border-radius: 16px;
            padding: 24px;
            transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
            position: relative;
            overflow: hidden;
        }

        .return-card::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            width: 4px;
            height: 100%;
            transition: background 0.3s;
        }

        .return-card.positive::before {
            background: var(--accent-green);
        }

        .return-card.negative::before {
            background: var(--accent-red);
        }

        .return-card:hover {
            transform: translateY(-4px);
            border-color: var(--accent-blue);
            box-shadow: 0 10px 30px rgba(0, 212, 255, 0.2);
        }

        .return-card-header {
            display: flex;
            justify-content: space-between;
            align-items: flex-start;
            margin-bottom: 16px;
        }

        .return-card-title {
            font-family: 'JetBrains Mono', monospace;
            font-size: 1.1rem;
            font-weight: 700;
            color: var(--text-primary);
        }

        .return-card-subtitle {
            font-size: 0.85rem;
            color: var(--text-muted);
            margin-top: 4px;
        }

        .return-card-return {
            font-family: 'JetBrains Mono', monospace;
            font-size: 1.8rem;
            font-weight: 700;
        }

        .return-card-return.positive {
            color: var(--accent-green);
        }

        .return-card-return.negative {
            color: var(--accent-red);
        }

        .return-card-stats {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 12px;
            margin-top: 16px;
            padding-top: 16px;
            border-top: 1px solid var(--border);
        }

        .return-card-stat {
            display: flex;
            flex-direction: column;
            gap: 4px;
        }

        .return-card-stat-label {
            font-size: 0.75rem;
            color: var(--text-muted);
            text-transform: uppercase;
            letter-spacing: 0.05em;
        }

        .return-card-stat-value {
            font-family: 'JetBrains Mono', monospace;
            font-size: 0.9rem;
            color: var(--text-secondary);
        }

        /* Responsive */
        @media (max-width: 1024px) {
            .content-grid {
                grid-template-columns: 1fr;
            }
            
            .header h1 {
                font-size: 2rem;
            }

            .returns-hero-value {
                font-size: 3rem;
            }
        }

        @media (max-width: 640px) {
            .dashboard {
                padding: 20px 15px;
            }

            .tabs {
                flex-direction: column;
            }

            .info-card {
                flex-direction: column;
                gap: 20px;
            }

            .chart-container {
                height: 300px;
            }

            .returns-hero {
                padding: 30px 20px;
            }

            .returns-hero-value {
                font-size: 2.5rem;
            }

            .returns-cards-grid {
                grid-template-columns: 1fr;
            }
        }
    </style>
</head>
<body>
    <div class="orb orb-1"></div>
    <div class="orb orb-2"></div>
    
    <div id="root"></div>

    <script type="text/babel">
        const { useState, useEffect, useRef } = React;
        // Custom crosshair plugin for vertical line on hover
        const crosshairPlugin = {
            id: 'crosshair',
            afterDatasetsDraw(chart, args, options) {
                const { ctx, chartArea: { top, bottom } } = chart;
                
                if (chart.tooltip?._active?.length) {
                    const activePoint = chart.tooltip._active[0];
                    const xPos = activePoint.element.x;
                    
                    ctx.save();
                    ctx.beginPath();
                    ctx.setLineDash([5, 5]);
                    ctx.moveTo(xPos, top);
                    ctx.lineTo(xPos, bottom);
                    ctx.lineWidth = 1;
                    ctx.strokeStyle = 'rgba(138, 146, 165, 0.4)';
                    ctx.stroke();
                    ctx.restore();
                }
            }
        };

        // Register the plugin globally
        Chart.register(crosshairPlugin);


        

        // Asset configuration with colors
        const assetConfig = {
            // Index
            'SPX': { name: 'S&P 500', color: '#00ff88', type: 'index' },
            
            // Sector ETFs
            'XLK': { name: 'Technology', color: '#00d4ff', type: 'sector' },
            'XLF': { name: 'Financials', color: '#ff6b35', type: 'sector' },
            'XLV': { name: 'Health Care', color: '#e91e63', type: 'sector' },
            'XLC': { name: 'Communication Services', color: '#9c27b0', type: 'sector' },
            'XLI': { name: 'Industrials', color: '#ffd700', type: 'sector' },
            'XLY': { name: 'Consumer Discretionary', color: '#ff1744', type: 'sector' },
            'XLP': { name: 'Consumer Staples', color: '#00e676', type: 'sector' },
            'XLE': { name: 'Energy', color: '#06b6d4', type: 'sector' },
            'XLU': { name: 'Utilities', color: '#2196f3', type: 'sector' },
            'XLRE': { name: 'Real Estate', color: '#f06292', type: 'sector' },
            'XLB': { name: 'Materials', color: '#ba68c8', type: 'sector' },
            
            // Cryptocurrencies
            'BTC': { name: 'Bitcoin', color: '#f7931a', type: 'crypto' },
            'ETH': { name: 'Ethereum', color: '#627eea', type: 'crypto' },

            const maxValue = Math.max(...data.map(d => Math.abs(d.value)));
            
            return (
                <div className="bar-chart">
                    {data.map((item, idx) => {
                        const percentage = (Math.abs(item.value) / maxValue) * 100;
                        const isPositive = item.value > 0.5;
                        const isNegative = item.value < -0.1;
                        const className = isNegative ? 'negative' : isPositive ? 'positive' : 'neutral';
                        
                        return (
                            <div 
                                key={item.ticker} 
                                className="bar-item"
                                style={{ animationDelay: `${idx * 0.05}s` }}
                            >
                                <div className="bar-label">

                                    </div>

                                <div className="bar-track">
                                    <div 
                                        className={`bar-fill ${className}`}
                                        style={{ width: `${percentage}%` }}

                                </div>
                            </div>
                        );

                const ctx = chartRef.current.getContext('2d');
                
                const datasets = Object.keys(activeAssets)
                    .filter(ticker => activeAssets[ticker])
                    .map(ticker => ({
                        label: `${ticker} (${assetConfig[ticker].name})`,
                        data: timeSeriesData[metric][ticker],
                        borderColor: assetConfig[ticker].color,
                        backgroundColor: assetConfig[ticker].color + '20',
                        borderWidth: 2,
                        tension: 0.4,
                        pointRadius: 0,
                        pointHoverRadius: 4,
                    }));

                chartInstance.current = new Chart(ctx, {
                    type: 'line',
                    data: {
                        labels: timeSeriesData.dates,
                        datasets: datasets
                    },
                    options: {
                        responsive: true,
                        maintainAspectRatio: false,
                        interaction: {
                            mode: 'index',
                            intersect: false,
                        },
                        plugins: {
                            legend: {
                                display: false
                            },

                            tooltip: {
                                backgroundColor: 'rgba(19, 23, 31, 0.95)',
                                titleColor: '#e4e6eb',
                                bodyColor: '#8b92a5',
                                borderColor: '#252934',
                                borderWidth: 1,
                                padding: 12,
                                titleFont: {
                                    family: 'JetBrains Mono',
                                    size: 12
                                },
                                bodyFont: {
                                    family: 'JetBrains Mono',
                                    size: 11
                                },
                                callbacks: {
                                    label: function(context) {
                                        return `${context.dataset.label}: ${context.parsed.y.toFixed(4)}`;
                                    }
                                }
                            }
                        },
                        scales: {
                            x: {
                                grid: {
                                    color: 'rgba(255, 255, 255, 0.03)',
                                    drawBorder: false
                                },
                                ticks: {
                                    color: '#5a5f73',
                                    font: {
                                        family: 'JetBrains Mono',
                                        size: 10
                                    },
                                    maxRotation: 0,
                                    autoSkipPadding: 50
                                }
                            },
                            y: {
                                grid: {
                                    color: 'rgba(255, 255, 255, 0.03)',
                                    drawBorder: false
                                },
                                ticks: {
                                    color: '#5a5f73',
                                    font: {
                                        family: 'JetBrains Mono',
                                        size: 10
                                    },
                                    callback: function(value) {
                                        return value.toFixed(2);
                                    }
                                }
                            }
                        }
                    }
                });

                return () => {
                    if (chartInstance.current) {
                        chartInstance.current.destroy();
                    }
                };
            }, [activeAssets, metric]);

            return (
                <div className="time-series-section">
                    <div className="section-header">
                        <div className="section-title">
                            Rolling {metric === 'correlations' ? 'Correlation' : 'Beta'} Time Series
                            <span className="section-badge">100-interval window</span>
                        </div>
                    </div>
                    
                    <div className="chart-controls">
                        {Object.keys(assetConfig).filter(ticker => ticker !== 'SPX').map(ticker => (
                            <button
                                key={ticker}
                                className={`asset-toggle ${activeAssets[ticker] ? 'active' : ''} ${assetConfig[ticker].type}`}
                                onClick={() => toggleAsset(ticker)}
                            >
                                <div className="toggle-indicator" style={{
                                    background: activeAssets[ticker] ? assetConfig[ticker].color : 'var(--text-muted)'
                                }}></div>
                                {ticker}
                            </button>
                        ))}
                    </div>
                    
                    <div className="chart-container">
                        <canvas ref={chartRef}></canvas>
                    </div>
                </div>
            );
        }

        function PriceChart() {
            const chartRef = useRef(null);
            const chartInstance = useRef(null);
            
            const [activeAssets, setActiveAssets] = useState({
                'SPX': true,
                'XLK': true,
                'XLF': false,
                'XLV': false,
                'XLC': false,
                'XLI': false,
                'XLY': false,
                'XLP': false,
                'XLE': true,
                'XLU': false,
                'XLRE': false,
                'XLB': false,
                'BTC': true,
                'ETH': true,
                'SOL': false
            });

            const toggleAsset = (ticker) => {
                setActiveAssets(prev => ({
                    ...prev,
                    [ticker]: !prev[ticker]
                }));
            };

            useEffect(() => {
                if (!chartRef.current || !priceTimeSeriesData.dates || priceTimeSeriesData.dates.length === 0) return;

                // Destroy existing chart
                if (chartInstance.current) {
                    chartInstance.current.destroy();
                }

                const ctx = chartRef.current.getContext('2d');
                
                const datasets = Object.keys(activeAssets)
                    .filter(ticker => activeAssets[ticker])
                    .map(ticker => ({
                        label: `${ticker} (${assetConfig[ticker].name})`,
                        data: priceTimeSeriesData.prices[ticker],
                        borderColor: assetConfig[ticker].color,
                        backgroundColor: assetConfig[ticker].color + '20',
                        borderWidth: 2.5,
                        tension: 0.4,
                        pointRadius: 0,
                        pointHoverRadius: 5,
                    }));

                chartInstance.current = new Chart(ctx, {
                    type: 'line',
                    data: {
                        labels: priceTimeSeriesData.dates,
                        datasets: datasets
                    },
                    options: {
                        responsive: true,
                        maintainAspectRatio: false,
                        interaction: {
                            mode: 'index',
                            intersect: false,
                        },
                        plugins: {
                            legend: {
                                display: false
                            },

                            tooltip: {
                                backgroundColor: 'rgba(19, 23, 31, 0.95)',
                                titleColor: '#e4e6eb',
                                bodyColor: '#8b92a5',
                                borderColor: '#252934',
                                borderWidth: 1,
                                padding: 12,
                                titleFont: {
                                    family: 'JetBrains Mono',
                                    size: 12
                                },
                                bodyFont: {
                                    family: 'JetBrains Mono',
                                    size: 11
                                },
                                callbacks: {
                                    label: function(context) {
                                        return `${context.dataset.label}: ${context.parsed.y.toFixed(2)}`;
                                    }
                                }
                            }
                        },
                        scales: {
                            x: {
                                grid: {
                                    color: 'rgba(255, 255, 255, 0.03)',
                                    drawBorder: false
                                },
                                ticks: {
                                    color: '#5a5f73',
                                    font: {
                                        family: 'JetBrains Mono',
                                        size: 10
                                    },
                                    maxRotation: 0,
                                    autoSkipPadding: 50
                                }
                            },
                            y: {
                                grid: {
                                    color: 'rgba(255, 255, 255, 0.03)',
                                    drawBorder: false
                                },
                                ticks: {
                                    color: '#5a5f73',
                                    font: {
                                        family: 'JetBrains Mono',
                                        size: 10
                                    },
                                    callback: function(value) {
                                        return value.toFixed(1);
                                    }
                                }
                            }
                        }
                    }
                });

                return () => {
                    if (chartInstance.current) {
                        chartInstance.current.destroy();
                    }
                };
            }, [activeAssets]);

            return (
                <div className="time-series-section">
                    <div className="section-header">
                        <div className="section-title">
                            Normalized Price Performance
                            <span className="section-badge">Base 100</span>
                        </div>
                    </div>
                    
                    <div className="chart-controls">
                        {Object.keys(assetConfig).map(ticker => (
                            <button
                                key={ticker}
                                className={`asset-toggle ${activeAssets[ticker] ? 'active' : ''} ${assetConfig[ticker].type}`}
                                onClick={() => toggleAsset(ticker)}
                            >
                                <div className="toggle-indicator" style={{
                                    background: activeAssets[ticker] ? assetConfig[ticker].color : 'var(--text-muted)'
                                }}></div>
                                {ticker}
                            </button>
                        ))}
                    </div>
                    
                    <div className="chart-container">
                        <canvas ref={chartRef}></canvas>
                    </div>
                </div>
            );
        }

        function Dashboard() {
            const [activeTab, setActiveTab] = useState('returns');

            return (
                <div className="dashboard">
                    <header className="header">
                        <h1>Equity and Crypto Market Dynamics Dash</h1>
                        <div className="subtitle">
                            <span>Correlation & Beta Analysis</span>
                            <span className="stat-pill">
                                Period: <strong>{dashboardData.stats.period}</strong>
                            </span>
                            <span className="stat-pill">
                                Intervals: <strong>{dashboardData.stats.total_intervals.toLocaleString()}</strong>
                            </span>
                            <span className="stat-pill">
                                SPX Vol: <strong>{(dashboardData.stats.spx_volatility * 100).toFixed(2)}%</strong>
                            </span>
                        </div>
                    </header>

                    <div className="tabs">
                        <button 
                            className={`tab ${activeTab === 'returns' ? 'active' : ''}`}
                            onClick={() => setActiveTab('returns')}
                        >
                            <span> Returns</span>
                        </button>
                        <button 
                            className={`tab ${activeTab === 'correlation' ? 'active' : ''}`}
                            onClick={() => setActiveTab('correlation')}
                        >
                            <span> Correlations</span>
                        </button>
                        <button 
                            className={`tab ${activeTab === 'beta' ? 'active' : ''}`}
                            onClick={() => setActiveTab('beta')}
                        >
                            <span> Betas</span>
                        </button>
                    </div>

                    {activeTab === 'returns' && (
                        <>
                            <PriceChart />

                            <div className="returns-grid">

                                <div className="section">
                                    <div className="section-header">
                                        <div className="section-title">
                                            Sector ETF Returns
                                            <span className="section-badge">{dashboardData.returns.sectors.length}</span>
                                        </div>
                                    </div>
                                    <div className="returns-cards-grid">
                                        {dashboardData.returns.sectors.map((asset, idx) => (
                                            <div 
                                                key={asset.ticker}
                                                className={`return-card ${asset.return_pct >= 0 ? 'positive' : 'negative'}`}
                                                style={{ animationDelay: `${idx * 0.05}s` }}
                                            >
                                                <div className="return-card-header">
                                                    <div>
                                                        <div className="return-card-title">{asset.ticker}</div>
                                                        <div className="return-card-subtitle">{asset.name}</div>
                                                    </div>
                                                    <div className={`return-card-return ${asset.return_pct >= 0 ? 'positive' : 'negative'}`}>
                                                        {asset.return_pct >= 0 ? '+' : ''}{asset.return_pct.toFixed(2)}%
                                                    </div>
                                                </div>
                                                <div className="return-card-stats">
                                                    <div className="return-card-stat">
                                                        <div className="return-card-stat-label">Start</div>
                                                        <div className="return-card-stat-value">${asset.start_price.toFixed(2)}</div>
                                                    </div>
                                                    <div className="return-card-stat">
                                                        <div className="return-card-stat-label">End</div>
                                                        <div className="return-card-stat-value">${asset.end_price.toFixed(2)}</div>
                                                    </div>
                                                    <div className="return-card-stat">
                                                        <div className="return-card-stat-label">High</div>
                                                        <div className="return-card-stat-value">${asset.high.toFixed(2)}</div>
                                                    </div>
                                                    <div className="return-card-stat">
                                                        <div className="return-card-stat-label">Low</div>
                                                        <div className="return-card-stat-value">${asset.low.toFixed(2)}</div>
                                                    </div>
                                                </div>
                                            </div>
                                        ))}
                                    </div>
                                </div>

                                <div className="section">
                                    <div className="section-header">
                                        <div className="section-title">
                                            Cryptocurrency Returns
                                            <span className="section-badge">{dashboardData.returns.crypto.length}</span>
                                        </div>
                                    </div>
                                    <div className="returns-cards-grid">
                                        {dashboardData.returns.crypto.map((asset, idx) => (
                                            <div 
                                                key={asset.ticker}
                                                className={`return-card ${asset.return_pct >= 0 ? 'positive' : 'negative'}`}
                                                style={{ animationDelay: `${idx * 0.05}s` }}
                                            >
                                                <div className="return-card-header">
                                                    <div>
                                                        <div className="return-card-title">{asset.ticker}</div>
                                                        <div className="return-card-subtitle">{asset.name}</div>
                                                    </div>
                                                    <div className={`return-card-return ${asset.return_pct >= 0 ? 'positive' : 'negative'}`}>
                                                        {asset.return_pct >= 0 ? '+' : ''}{asset.return_pct.toFixed(2)}%
                                                    </div>
                                                </div>
                                                <div className="return-card-stats">
                                                    <div className="return-card-stat">
                                                        <div className="return-card-stat-label">Start</div>
                                                        <div className="return-card-stat-value">${asset.start_price.toLocaleString('en-US', {minimumFractionDigits: 2, maximumFractionDigits: 2})}</div>
                                                    </div>
                                                    <div className="return-card-stat">
                                                        <div className="return-card-stat-label">End</div>
                                                        <div className="return-card-stat-value">${asset.end_price.toLocaleString('en-US', {minimumFractionDigits: 2, maximumFractionDigits: 2})}</div>
                                                    </div>
                                                    <div className="return-card-stat">
                                                        <div className="return-card-stat-label">High</div>
                                                        <div className="return-card-stat-value">${asset.high.toLocaleString('en-US', {minimumFractionDigits: 2, maximumFractionDigits: 2})}</div>
                                                    </div>
                                                    <div className="return-card-stat">
                                                        <div className="return-card-stat-label">Low</div>
                                                        <div className="return-card-stat-value">${asset.low.toLocaleString('en-US', {minimumFractionDigits: 2, maximumFractionDigits: 2})}</div>
                                                    </div>
                                                </div>
                                            </div>
                                        ))}
                                    </div>
                                </div>
                            </div>
                        </>
                    )}

                    {activeTab === 'correlation' && (
                        <>
                            <div className="info-card">
                                <div className="info-stat">
                                    <div className="info-stat-label">Metric</div>
                                    <div className="info-stat-value">Correlation</div>
                                </div>
                                <div className="info-stat">
                                    <div className="info-stat-label">Interpretation</div>
                                    <div className="info-stat-value" style={{fontSize: '1.2rem', color: 'var(--text-secondary)'}}>
                                        Pearson correlation coefficient measuring linear relationship between asset and SPX returns (-1 to +1). Calculated using 10-minute interval returns over the full period. Rolling time series uses 100-interval (~2.5 trading days) sliding window to capture dynamic relationship changes.
                                    </div>
                                </div>
                            </div>

                            <div className="legend">
                                <div className="legend-item">
                                    <div className="legend-dot sector"></div>
                                    <span>Sector ETFs</span>
                                </div>
                                <div className="legend-item">
                                    <div className="legend-dot crypto"></div>
                                    <span>Cryptocurrencies</span>
                                </div>
                            </div>

                            <div className="content-grid">
                                <div className="section">
                                    <div className="section-header">
                                        <div className="section-title">
                                            Sector ETFs
                                            <span className="section-badge">{dashboardData.correlations.sectors.length}</span>
                                        </div>
                                    </div>
                                    <BarChart 
                                        data={dashboardData.correlations.sectors} 
                                        type="sector"
                                        metric="correlation"
                                    />
                                </div>

                                <div className="section">
                                    <div className="section-header">
                                        <div className="section-title">
                                            Cryptocurrencies
                                            <span className="section-badge">{dashboardData.correlations.crypto.length}</span>
                                        </div>
                                    </div>
                                    <BarChart 
                                        data={dashboardData.correlations.crypto} 
                                        type="crypto"
                                        metric="correlation"
                                    />
                                </div>
                            </div>

                            <TimeSeriesChart metric="correlations" />
                        </>
                    )}

                    {activeTab === 'beta' && (
                        <>
                            <div className="info-card">
                                <div className="info-stat">
                                    <div className="info-stat-label">Metric</div>
                                    <div className="info-stat-value">Beta</div>
                                </div>
                                <div className="info-stat">
                                    <div className="info-stat-label">Interpretation</div>
                                    <div className="info-stat-value" style={{fontSize: '1.2rem', color: 'var(--text-secondary)'}}>
                                        Beta coefficient () = Cov(Asset, SPX) / Var(SPX), measuring systematic risk and volatility relative to market. Calculated from 10-minute returns using OLS regression. =1 means moves 1:1 with market, {'>'}1 is more volatile, {'<'}1 is less volatile. Rolling window: 100 intervals (~2.5 days).
                                    </div>
                                </div>
                            </div>

                            <div className="legend">
                                <div className="legend-item">
                                    <div className="legend-dot sector"></div>
                                    <span>Sector ETFs</span>
                                </div>
                                <div className="legend-item">
                                    <div className="legend-dot crypto"></div>
                                    <span>Cryptocurrencies</span>
                                </div>
                            </div>

                            <div className="content-grid">
                                <div className="section">
                                    <div className="section-header">
                                        <div className="section-title">
                                            Sector ETFs
                                            <span className="section-badge">{dashboardData.betas.sectors.length}</span>
                                        </div>
                                    </div>
                                    <BarChart 
                                        data={dashboardData.betas.sectors} 
                                        type="sector"
                                        metric="beta"
                                    />
                                </div>

                                <div className="section">
                                    <div className="section-header">
                                        <div className="section-title">
                                            Cryptocurrencies
                                            <span className="section-badge">{dashboardData.betas.crypto.length}</span>
                                        </div>
                                    </div>
                                    <BarChart 
                                        data={dashboardData.betas.crypto} 
                                        type="crypto"
                                        metric="beta"
                                    />
                                </div>
                            </div>

                            <TimeSeriesChart metric="betas" />
                        </>
                    )}
                </div>
            );
        }

        ReactDOM.render(<Dashboard />, document.getElementById('root'));
    </script>
</body>
</html>
